Gems TV
The work of Steve and Sarah Bennett, who run a jewellery shopping channel broadcasting to Europe and North America 24 hours a day. With a turnover of around Ã‚Â£100million a year, part of the family's success lies in their business method - purchasing direct from the mines and keeping costs low - but there are problems on the horizon. There's an urgent need for new on-screen presenting talent in the run-up to Christmas and supplies of the best-selling gemstone - Tanzanite - are fast running out. Narrated by Liza Tarbuck.

